import React from "react";
import "./HeaderBottom.css";
import Menu from "@material-ui/icons/Menu";

function HeaderBottom() {
  return (
    <div className="headerBottom">
      <div className="headerBottom__container">
        <Menu className="headerBottom__icon" />
        <p className="headerBottom__title">All</p>
      </div>
      <p className="headerBottom__title">Prime Video</p>
      <p className="headerBottom__title">Amazon Busines</p>
      <p className="headerBottom__title">Today's Deals</p>
      <p className="headerBottom__title">Electronics</p>
      <p className="headerBottom__title">Food & Grocery</p>
      <p className="headerBottom__title">All</p>

    </div>
  );
}

export default HeaderBottom;
